import {useSelector, useDispatch} from "react-redux";
import { logout } from "../redux/actions";
import OnboardingSlides from "../components/OnboardingSlides";

const Home = () => {
    const onboardingComplete = useSelector(state => state.user.onboardingComplete);
    const dispatch = useDispatch();

    const handleLogout = () => {
        dispatch(logout());
    }

    if (onboardingComplete) {
        return (
            <div className="container home my-4">
                <nav className="navbar navbar-light bg-light">
                    <div className="container-fluid">
                        <a className="navbar-brand mx-auto font" href="#home" onClick={()=>{

                            }}>
                            Jobs
                        </a>
                    </div>
                </nav>
                <div>
                    <button className="btn btn-secondary float-end" onClick={handleLogout}>
                        Logout
                    </button>
                </div>
            </div>
        )
    } else {
        return (
            <OnboardingSlides/>
        )
    }
}

export default Home
